import React from 'react'
import Navbar from "./components/Navbar";
import Cta from "./components/CTA";
import Footer from "./components/Footer";
// import { render } from '@headlessui/react/dist/utils/render';

class App extends React.Component {

  render() {
    return (
      <div>
        <Navbar />
        <div className="max-w-7xl mx-auto mt-16 mb-32 px-4 sm:px-6 lg:px-8">
          <div className=" mx-auto text-left">
            <h2 className="text-4xl font-extrabold text-gray-900">Media</h2>
            <p className="mt-4 text-lg text-gray-500">
              The most important first step for any product is to understand what
              it's trying to accomplish. At Wolfware, we're passionate about
              developing the right strategy for every business so they're on a
              path to succeed before the first design has been drawn.
            </p>
          </div>
        </div>
        <div id="medium-widget"></div>
        <Cta />
        <Footer />
      </div>
    );
  }
}


export default App;
